  render() {
    return (
      <div className='full-contact'>
        <FaTimes className='krestik' onClick={() => this.props.onShowItem(this.props.item)}/>
        <h2>{this.props.contact.whatsapp}</h2>
        <h2>{this.props.contact.whatsapp}</h2>
        <h2>{this.props.contact.whatsapp}</h2>
      </div>
    )
  }
}

